import React from "react";
import classes from "./all.module.css";

function Home(props) {
    return (
        <div className="home">
            <div className="container">
                <h1 className={classes.par}>Home page text block</h1>
                <p className={classes.ab}>
                    Это тестовый текст описания проекта
                </p>
                <p className={`${classes.imp} ${classes.ab}`}>
                    Еще немного тестового текста
                    овламтоывлмтоывстоывстоооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооооо
                </p>
                <blockquote>{props.quote}</blockquote>
            </div>
        </div>
    );
}

export default Home;
